                fontSize: 24,

                }
            }
        },
        yAxis: {
            type: 'value',
            boundaryGap: ['20%', '20%'],
            axisLabel: {
                formatter: function (value, index) {
                    switch (unit) {
                        case SUPPORTED_UNITS.percent_0_to_1: {
                            return `${(parseFloat(value) * 100).toFixed(2)}%`;
                        }
                        case SUPPORTED_UNITS.second: {
                            return `${value * 1000}ms`
                        }
                    }
                    return value;
                }
            }
        },
        series: dataSet.map(data => {
            return {
                name: data.name,
                type: 'line',
                smooth: true,
                symbol: 'none',
                xAxis: {
                    type: 'time',
                    boundaryGap: false
                },
                yAxis: {
                    type: 'value',
                    boundaryGap: [0, '100%']
                },
                data: data.values
            };
        })
    };

});
window.myChart.setOption(options);
